[Action<VendorInvite>(Modal = ModalMode.Medium)]
      [Visibility<Admin>]
      public class Invite : YAction
      {
        public virtual ActionConfirm Frm { get; set; }
        public override void OnExecute()
        {
          base.OnExecute();

          //Create CheckListAnswers Collection based on AuditType
          var q = Context.BO.Search<AuditRequirement>(x => x.AuditType.Id == Context.Item.AuditType.Id, 0, 30).ToArray();
          var coll = new List<AuditResponse>();
          foreach (var item in q)
          {
            var newResp = (new AuditResponse
            {
              WIId = Context.Item.Id,
              AuditRequirement = item,
              RequirementSection = item.Section,
              RequirementName = item.Name,
              AuditResponseStatus = Context.BO.GetById<AuditResponseStatus>("1"),
              Observation = "",
              CorrectiveAction = "",
              DocumentEvidence = null,
              Responsible = "",
              DaysExpire = 0,
              Verified = false
            });
            //Context.BO.Insert<AuditResponse>(newAnswer);
            coll.Add(newResp);
          }
          Context.Item.AuditResponse = coll;
        }
        public override void OnPrepare()
        {
          base.OnPrepare();
          Frm.ActionMsg.Value = "Send the audit invitation to the vendor?";
          Frm.ActionNote.Required = false;
        }
      }

[Action<Executing>(Modal = ModalMode.None)]
      [Visibility<Admin>]
      public class CheckListEdit : YAction
      {
        public virtual ExecEdit2 Frm { get; set; }
        public override void OnExecute()
        {
          base.OnExecute();

          if (Context.Item.ExecStart == new DateOnly(1980, 1, 1))
            Context.Item.ExecStart = DateOnly.FromDateTime(DateTime.Now);

          Context.Item.ExecEdit = DateOnly.FromDateTime(DateTime.Now);

          //Init WI Resp fields
          Context.Item.RespHNCZT=false;
          Context.Item.RespNC = 0;
          Context.Item.RespRequirements = 0;
          Context.Item.RespTotRequirements = Context.Item.AuditResponse.Count;

          int i = 0;
          foreach (var aq in Context.Item.AuditResponse)
          {
            aq.AuditResponseStatus = Frm.Sta[i].Value;
            aq.Observation = Frm.Obs[i].Value;
            aq.Verified = Frm.Ver[i].Value;

            if (Frm.Sta[i].Value.Id == 1 || Frm.Sta[i].Value.Id == 4)
            {
              aq.CorrectiveAction = "";
              aq.Responsible = "";
              aq.DaysExpire = 0;
            }
            else
            {
              aq.CorrectiveAction = Frm.Ca[i].Value;
              aq.Responsible = Frm.Resp[i].Value;
              aq.DaysExpire = (int)Frm.DE[i].Value;
            }


            //Update WI fields
            if (Frm.Sta[i].Value.Id > 1)
              Context.Item.RespRequirements++;

            if (Frm.Sta[i].Value.Id == 2 || Frm.Sta[i].Value.Id == 3)
            {
              Context.Item.RespNC++;
              if (aq.AuditRequirement.HNC || aq.AuditRequirement.ZT)
                Context.Item.RespHNCZT = true;
            }
            i++;
          }
        }
      }

